import React, { useState, useEffect } from 'react';
import {
  CssVarsProvider,
  extendTheme,
  useColorScheme,
} from '@mui/joy/styles';
import GlobalStyles from '@mui/joy/GlobalStyles';
import CssBaseline from '@mui/joy/CssBaseline';
import Box from '@mui/joy/Box';
import Button from '@mui/joy/Button';
import Divider from '@mui/joy/Divider';
import FormControl from '@mui/joy/FormControl';
import FormLabel from '@mui/joy/FormLabel';
import IconButton from '@mui/joy/IconButton';
import Link from '@mui/joy/Link';
import Input from '@mui/joy/Input';
import Typography from '@mui/joy/Typography';
import Stack from '@mui/joy/Stack';
import DarkModeRoundedIcon from '@mui/icons-material/DarkModeRounded';
import LightModeRoundedIcon from '@mui/icons-material/LightModeRounded';
import Select from '@mui/joy/Select';
import Option from '@mui/joy/Option';
import Textarea from '@mui/joy/Textarea';

const customTheme = extendTheme({
  defaultColorScheme: 'dark',
});

function ColorSchemeToggle({ onClick }) {
  const { mode, setMode } = useColorScheme();
  const [mounted, setMounted] = useState(false);

  useEffect(() => setMounted(true), []);

  const handleClick = (event) => {
    setMode(mode === 'light' ? 'dark' : 'light');
    if (onClick) onClick(event);
  };

  return (
    <IconButton
      aria-label="toggle light/dark mode"
      size="sm"
      variant="outlined"
      disabled={!mounted}
      onClick={handleClick}
    >
      {mode === 'light' ? <DarkModeRoundedIcon /> : <LightModeRoundedIcon />}
    </IconButton>
  );
}

export default function JoySignUpSideTemplate() {
  const [gender, setGender] = useState('');

  const handleGenderChange = (event) => {
    const { value } = event.target;
    setGender(value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const formElements = event.currentTarget.elements;

    const formData = new FormData();
    const dateOfBirth = formElements.dateOfBirth.value;
    const formattedDate = new Date(dateOfBirth).toISOString().split('T')[0];

    formData.append(
      'user',
      JSON.stringify({
        username: formElements.username.value,
        password: formElements.password.value,
        firstName: formElements.firstName.value,
        lastName: formElements.lastName.value,
        dateOfBirth: formattedDate,
        gender,
        email: formElements.email.value,
        phoneNumber: formElements.phone.value,
        interests: formElements.interests.value,
      })
    );

    const profilePicture = formElements.profilePicture.files[0];
    if (profilePicture) {
      formData.append('profilePicture', profilePicture);
    }

    try {
      const response = await fetch('/users/signup', {
        method: 'POST',
        body: formData,
      });

      if (response.ok) {
        const responseData = await response.json();
        alert('Kayıt başarılı!');
        console.log('Kullanıcı başarıyla oluşturuldu:', responseData);
      } else {
        const error = await response.text();
        alert(`Bir hata oluştu: ${error}`);
        console.error('Hata oluştu:', error);
      }
    } catch (error) {
      alert('Sunucuya bağlanırken bir hata oluştu.');
      console.error('Sunucuya bağlanırken hata:', error);
    }
  };

  return (
    <CssVarsProvider theme={customTheme} disableTransitionOnChange>
      <CssBaseline />
      <GlobalStyles
        styles={{
          ':root': {
            '--Form-maxWidth': '800px',
            '--Transition-duration': '0.4s',
          },
        }}
      />
      <Box sx={{ width: { xs: '100%', md: '50vw' }, position: 'relative', display: 'flex', justifyContent: 'flex-end', backdropFilter: 'blur(12px)' }}>
        <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh', width: '100%', px: 2 }}>
          <Box component="header" sx={{ py: 3, display: 'flex', justifyContent: 'space-between' }}>
            <ColorSchemeToggle />
          </Box>
          <Box component="main" sx={{ my: 'auto', py: 2, pb: 5, display: 'flex', flexDirection: 'column', gap: 2, width: 400, mx: 'auto', borderRadius: 'sm' }}>
            <Stack sx={{ gap: 4, mb: 2 }}>
              <Typography component="h1" level="h3">Kaydol</Typography>
              <Typography level="body-sm">
                Zaten bir hesabın var mı?{' '}
                <Link href="/login" level="title-sm">Giriş Yap</Link>
              </Typography>
            </Stack>
            <Divider>ya da</Divider>
            <form onSubmit={handleSubmit}>
              <FormControl required>
                <FormLabel>Kullanıcı Adı</FormLabel>
                <Input type="text" name="username" />
              </FormControl>
              <FormControl required>
                <FormLabel>Şifre</FormLabel>
                <Input type="password" name="password" />
              </FormControl>
              <FormControl required>
                <FormLabel>Ad</FormLabel>
                <Input type="text" name="firstName" />
              </FormControl>
              <FormControl required>
                <FormLabel>Soyad</FormLabel>
                <Input type="text" name="lastName" />
              </FormControl>
              <FormControl required>
                <FormLabel>Doğum Tarihi</FormLabel>
                <Input type="date" name="dateOfBirth" />
              </FormControl>
              <FormControl required>
                <FormLabel>Cinsiyet</FormLabel>
                <Select name="gender" value={gender} onChange={handleGenderChange}>
                  <Option value="male">Erkek</Option>
                  <Option value="female">Kadın</Option>
                </Select>
              </FormControl>
              <FormControl required>
                <FormLabel>E-posta Adresi</FormLabel>
                <Input type="email" name="email" />
              </FormControl>
              <FormControl required>
                <FormLabel>Telefon Numarası</FormLabel>
                <Input type="tel" name="phone" />
              </FormControl>
              <FormControl>
                <FormLabel>İlgi Alanları</FormLabel>
                <Textarea name="interests" placeholder="İlgi alanlarınızı girin" />
              </FormControl>
              <FormControl>
                <FormLabel>Profil Fotoğrafı</FormLabel>
                <Input type="file" name="profilePicture" accept="image/*" />
              </FormControl>
              <Button type="submit" fullWidth>Kaydol</Button>
            </form>
          </Box>
        </Box>
      </Box>
      <Box sx={{
        position: 'fixed', top: 0, right: 0, bottom: 0, left: { xs: 0, md: '50vw' }, 
        backgroundImage: 'url(https://images.unsplash.com/photo-1527181152855-fc03fc7949c8?auto=format&w=1000&dpr=2)', 
        backgroundSize: 'cover', backgroundPosition: 'center', backgroundRepeat: 'no-repeat',
      }} />
    </CssVarsProvider>
  );
}
